var piePatternSrc =
    'data:image/jpeg;base64,';

var piePatternImg = new Image();
piePatternImg.src = piePatternSrc;
var data1 = [{ value: 100 }, { value: 100 }, { value: 100 }, { value: 100 }];
var data2 = [{ value: 5 }, { value: 0 }, { value: 0 }, { value: 10 }];

for (let i = 0; i < data2.length; i++) {
    if (data2[i].value === 0) {
        data1[i] = {
            value: data1[i].value,
            itemStyle: {
                barBorderRadius: [5, 5, 0, 0],
            },
             label: {
                    show: true, //开启显示
                    position : 'top',
                    textStyle: {
                        //数值样式
                        color: 'grey',
                        fontSize: 15,
                    },
                },
        };
    } else {
         data1[i] = {
            value: data1[i].value,
             label: {
                    show: true, //开启显示
                    position : [20,0],
                    textStyle: {
                        //数值样式
                        color: 'grey',
                        fontSize: 15,
                    },
                },
        };
        data2[i] = {
            value: data2[i].value,
            itemStyle: {
                barBorderRadius: [5, 5, 0, 0],
            },
             label: {
                    show: true, //开启显示
                    position : 'top',
                    textStyle: {
                        //数值样式
                        color: 'grey',
                        fontSize: 15,
                    },
                },
        };
    }
}

